        public string Key { get; }

        public SoundMaster(string key)
        {
            Key = key;
        }

        public static void PlayVoice(SoundMaster key, float pitchVar = 0, bool random = true)
        {
            if (pitchVar != 0)
                MediaManager.PlayVoice(key.Key, false, 1 + (random ? Random.Range(-pitchVar, pitchVar) : pitchVar)).Forget();
            else
                MediaManager.PlayVoice(key.Key).Forget();
        }
